import React, { useContext } from "react";
import { StateContext } from "./context";

function Order() {
  const { orders } = useContext(StateContext);
  return (
    <div>
      {orders.length ? (
        orders.map((order) => <h1>{order}</h1>)
      ) : (
        <h1>No orders</h1>
      )}
    </div>
  );
}

export default Order;
